    constructor(props) {
        super(props);
        this.state = {
            items: [],
            n: 0
        }
        this.handleClick = this.handleClick.bind(this);
    }

    componentDidMount() {
        console.log(ResultData[0]);
        
    }

    handleClick() {
        this.forceUpdate();
        console.log("update")
    }
    
    render() {
        
        return(
            <section className="table">
                <div className="table__content _container">
                    <div className="table__row">
                        <div onClick={this.handleClick}>123</div>
                        <ul className="table__list">
                            {this.state.items.map(( item, index ) => {
                                return(
                                    <li className="table__block" key={index}>{item.num}</li>
                                )
                            })}
                        </ul>
                    </div>
                </div>
            </section>
        )
    } 
}
